using System.Collections.Generic;
using System.Threading.Tasks;

using FactorioToolkit.Domain.Items;
using FactorioToolkit.Infrastructure;
using FactorioToolkit.Infrastructure.Repositories;

using Microsoft.VisualStudio.TestTools.UnitTesting;

using Shouldly;

namespace FactorioToolkit.Blueprints.UnitTests
{
    [TestClass]
    public class BlueprintFactoryTests
    {
        private const string BlueprintString = "";
        private const string BlueprintBookString = "";
        private const string BlueprintWithRails = "";

        private readonly BlueprintFactory testee;
        private readonly BlueprintUtilities utilities;

        public BlueprintFactoryTests()
        {
            testee = new BlueprintFactory(new ItemRepository());
            utilities = new BlueprintUtilities();
        }

        [TestMethod]
        public async Task GetBlueprint_ReturnBlueprint()
        {
            var blueprint = await utilities.GetBlueprint(BlueprintString).ConfigureAwait(false);

            var result = testee.GetBlueprint(blueprint);

            result.ShouldNotBeNull();
        }
    }
}
